import { Component } from "react";
class Time extends Component {
  constructor(props) {
    super(props);
    this.state = {
      timeNow: "",
    };

    setInterval(() => {
      this.setState({ timeNow: getDateTime() });
    }, 1000);
  }

  render() {
    return <div className="TimeNow">{this.state}</div>;
  }
}
function getDateTime() {
  return Date.prototype.getTime();
}

export default Time;
